const dates = [];
for (let i = 0; i <= 31; i++) {
  dates.push(
    data.data[i].day,
  );
}

const A = [];
for (let i = 0; i < 31; i++) {
  A.push(
    data.data[i].userA,
  );
}

const B = [];
for (let i = 0; i < 31; i++) {
  B.push(
    data.data[i].userB,
  );
}


const C = [];
for (let i = 0; i < 31; i++) {
  C.push(
    data.data[i].userC,
  );
}


const D = [];
for (let i = 0; i < Object.keys(data.data).length; i++) {
  D.push(
    data.data[i].userD,
  );
}


class ThirdComponent extends React.Component {

  // state = {
