  //           width: 800
  //         },
  //         legend: {
  //           position: 'bottom'
  //         }
  //       }
  //     }]
  //   }
  // };


  state = {
    series: [
      {
        name: 'userA',
        data: A
      },
      {
        name: 'userB',
        data: B
      },
      {
        name: 'userC',
        data: C
      },
      {
        name: 'userD',
        data: D
      }
    ],
    options: {
      chart: {
        height: 800,
        type: 'line',
        id: 'areachart-2'
      },
      annotations: {
        yaxis: [{
          y: 8600,
          y2: 9000,
          borderColor: '#000',
          fillColor: '#FEB019',
          opacity: 0.2,
          label: {
            borderColor: '#333',
            style: {
              fontSize: '10px',
