        xaxis: [{
          // x: new Date('20 March 2020').getdate(),
          x: '20 Mar',
          strokeDashArray: 0,
          borderColor: '#775DD0',
          label: {
            borderColor: '#775DD0',
            style: {
              color: '#fff',
